import streamlit as st
import base64, requests
from PIL import Image
from io import BytesIO
from pillow_heif import register_heif_opener

# Registra el "opener" para que Pillow soporte HEIC
register_heif_opener()

# Imagen base64 embebida
icon_base64 = """

"""  # <-- Peg aqu el base64 completo si lo truncaste

# Decodifica y carga como imagen PIL
icon_data = base64.b64decode(icon_base64)
icon_image = Image.open(BytesIO(icon_data))

# Configura la pestaa
st.set_page_config(
    page_title="OCR DEMO",
    page_icon=icon_image,
    layout="centered"
)

st.title("OCR de Cdulas o Pasaportes")

# 1. Seleccionar imgenes (mximo 2) y previsualizarlas en una fila
uploaded_files = st.file_uploader("Selecciona imgenes (mximo 2)", accept_multiple_files=True, type=['png','jpg','jpeg', 'dng'])
if uploaded_files:
    if len(uploaded_files) > 2:
        st.warning("Solo se procesarn las primeras 2 imgenes.")
        uploaded_files = uploaded_files[:2]
    with st.expander("Previsualizacin"):
        cols = st.columns(len(uploaded_files))
        for i, file in enumerate(uploaded_files):
            cols[i].image(file, caption=file.name, use_container_width=True)

# 2. Llamada al servidor para obtener los datos del OCR
if st.button("Enviar"):
    if uploaded_files:
        images_base64 = [base64.b64encode(file.read()).decode('utf-8') for file in uploaded_files]
        url = "https://radically-inspired-dodo.ngrok-free.app/id-ocr"  # Ajusta la URL segn tu entorno
        payload = {"images": images_base64}
        headers = {"Content-Type": "application/json"}
        response = requests.post(url, json=payload, headers=headers)
        try:
            result = response.json()
        except Exception:
            st.error("Error al decodificar la respuesta del servidor")
            result = {}
        if "text_data" in result:
            st.session_state.ocr_result = result
            st.success("Datos recibidos del servidor")
        else:
            error_msg = result.get("detail", "No se encontraron datos en la respuesta")
            st.error(error_msg)
    else:
        st.warning("Selecciona al menos una imagen.")

# 3. Mostrar el formulario prellenado y, al pulsar "Checked", enviar los datos al endpoint /checked
if "ocr_result" in st.session_state:
    data = st.session_state.ocr_result
    st.subheader("Formulario OCR")
    st.warning("Puedes corregir los datos incorrectos y apretar el boton \"Chequeado\" para mejorar la deteccin.")
    with st.form("formulario_ocr"):
        st.write("Tipo:", data.get("type", "N/A"))
        form_data = {}
        for key, value in data.get("text_data", {}).items():
            form_data[key] = st.text_input(key, value)
        if st.form_submit_button("Chequeado"):
            payload = {"type": data.get("type", "N/A"), "text_data": form_data}
            url = "https://radically-inspired-dodo.ngrok-free.app/checked"  # Ajusta la URL segn tu entorno
            headers = {"Content-Type": "application/json"}
            response = requests.post(url, json=payload, headers=headers)
            if response.ok:
                st.success("Gracias por probar la demo!!")
            else:
                st.error("Error al enviar datos: " + response.text)
